type propTypes = {
	project: { 
    name: string,
    img: string,
    link: string
  },
}

export const AllProjects = () => {
	return (
		<StyledAllProjects id="All Projects">
			<SquareOne/>
			<SquareTwo/>
			<SquareThree/>
			<SquareFour/>
		</StyledAllProjects>
	)
}
